import React from 'react';
import PropTypes from 'prop-types';
import { users } from '../data/feedData';

console.log(users['123'].name);

const User = ({ user }) => (
  <h2>
    { user }
    `${users['123'].name}
    `
  </h2>
);

User.propTypes = {
  // users: PropTypes.checkPropTypes(),
  user: PropTypes.string.isRequired,
};

export default User;
